import React from "react";
import styled from "styled-components";
import Hello from "../components/Home/Hello";
import AboutMe from "../components/Home/AboutMe";
import Project from "../components/Home/Project";
import Storage from "../components/Home/Storage";
import Github from "../components/Home/Github";
import Study from "../components/Home/Study";

const Background = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #e29f91;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const Box = styled.div`
  width: 1440px;
  height: 850px;
  background: #fdfbf8;

  display: flex;
  justify-content: space-between;
  align-items: center;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Left = styled.div`
  width: 200px;
  height: 100%;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Right = styled.div`
  width: 200px;
  height: 100%;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Top = styled.div`
  height: 60px;
  width: 1040px;

  display: flex;
  justify-content: flex-end; /* 오른쪽 정렬 */
  align-items: center; /* 수직 가운데 정렬 */

  border: 1px solid black;
  box-sizing: border-box;
`;

const SVGContainer = styled.div`
  display: flex;
  gap: 20px; /* 두 SVG 사이 간격 */
`;

const Content = styled.div`
  height: 715px;
  width: 1040px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Bottom = styled.div`
  height: 75px;
  width: 1040px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const ItemsContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 40px;
`;

const ContentLayout = styled.div`
  display: flex;
  align-items: flex-start;
  gap: 40px;
`;

const ContentLayout2 = styled.div`
  display: flex;
  align-items: flex-start;
  gap: 40px;
  margin-top: 40px;
`;

export default function Home() {
  return (
    <Background>
      <Box>
        <Left></Left>
        <div>
          <Top>
            <SVGContainer>
              {/* 첫 번째 SVG */}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="24"
                height="24"
                viewBox="0 0 24 24"
                fill="none">
                <path
                  d="M20.3812 10.875L18.75 9.24488V5.25C18.75 4.63125 18.2438 4.125 17.625 4.125H16.5C15.8812 4.125 15.375 4.63125 15.375 5.25V5.87212L13.125 3.62438C12.8179 3.33413 12.5366 3 12 3C11.4634 3 11.1821 3.33413 10.875 3.62438L3.61875 10.875C3.26775 11.2406 3 11.5073 3 12C3 12.6334 3.486 13.125 4.125 13.125H5.25V19.875C5.25 20.4938 5.75625 21 6.375 21H8.625C9.24632 21 9.75 20.4963 9.75 19.875V15.375C9.75 14.7562 10.2562 14.25 10.875 14.25H13.125C13.7438 14.25 14.25 14.7562 14.25 15.375V19.875C14.25 20.4963 14.1912 21 14.8125 21H17.625C18.2438 21 18.75 20.4938 18.75 19.875V13.125H19.875C20.514 13.125 21 12.6334 21 12C21 11.5073 20.7322 11.2406 20.3812 10.875Z"
                  stroke="#4A4E4D"
                  stroke-width="2"
                  stroke-linejoin="round"
                />
              </svg>

              {/* 두 번째 SVG */}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                width="24"
                height="24"
                viewBox="0 0 24 24"
                fill="none">
                <path
                  d="M12 14.9999C13.6569 14.9999 15 13.6568 15 11.9999C15 10.3431 13.6569 8.99994 12 8.99994C10.3431 8.99994 9 10.3431 9 11.9999C9 13.6568 10.3431 14.9999 12 14.9999Z"
                  stroke="#4A4E4D"
                  stroke-width="2"
                  stroke-miterlimit="10"
                  stroke-linecap="round"
                  stroke-linejoin="round"
                />
                <path
                  d="M2 12.8799V11.1199C2 10.0799 2.85 9.21994 3.9 9.21994C5.71 9.21994 6.45 7.93994 5.54 6.36994C5.02 5.46994 5.33 4.29994 6.24 3.77994L7.97 2.78994C8.76 2.31994 9.78 2.59994 10.25 3.38994L10.36 3.57994C11.26 5.14994 12.74 5.14994 13.65 3.57994L13.76 3.38994C14.23 2.59994 15.25 2.31994 16.04 2.78994L17.77 3.77994C18.68 4.29994 18.99 5.46994 18.47 6.36994C17.56 7.93994 18.3 9.21994 20.11 9.21994C21.15 9.21994 22.01 10.0699 22.01 11.1199V12.8799C22.01 13.9199 21.16 14.7799 20.11 14.7799C18.3 14.7799 17.56 16.0599 18.47 17.6299C18.99 18.5399 18.68 19.6999 17.77 20.2199L16.04 21.2099C15.25 21.6799 14.23 21.3999 13.76 20.6099L13.65 20.4199C12.75 18.8499 11.27 18.8499 10.36 20.4199L10.25 20.6099C9.78 21.3999 8.76 21.6799 7.97 21.2099L6.24 20.2199C5.33 19.6999 5.02 18.5299 5.54 17.6299C6.45 16.0599 5.71 14.7799 3.9 14.7799C2.85 14.7799 2 13.9199 2 12.8799Z"
                  stroke="#4A4E4D"
                  stroke-width="2"
                  stroke-miterlimit="10"
                  stroke-linecap="round"
                  stroke-linejoin="round"
                />
              </svg>
            </SVGContainer>
          </Top>

          <Content>
            <ContentLayout>
              <ItemsContainer>
                <Hello />
                <AboutMe />
              </ItemsContainer>
              <Project />
            </ContentLayout>
            <ContentLayout2>
              <Storage></Storage>
              <Github></Github>
              <Study></Study>
            </ContentLayout2>
          </Content>
          <Bottom></Bottom>
        </div>
        <Right></Right>
      </Box>
    </Background>
  );
}
